import React from 'react';
import {FaInstagram, FaLinkedinIn} from 'react-icons/fa';
import { FiFacebook } from 'react-icons/fi';


class Footer extends React.Component{
    render(){
        return(
            <div>
            <div>
                <FaInstagram />
                <FiFacebook />
                <FaLinkedinIn />

            </div>
            </div>
        );
    }
}

export default Footer;
